export default async function RequisitionFood() {
  const url = 'https://www.themealdb.com/api/json/v1/1/filter.php?i=';
  const responseApi = await fetch(url)
    .then((parameter) => parameter.json());
  const { meals } = responseApi;
  fetchData();
  return meals;
}
